import React from 'react';

function FormField({ textarea, label, type, name, value, onChange }) {
    return (
        <div>
          <label>
            {label}: 
            <input 
            textarea = <textarea />
                type={type}
                value={value}
                name={name}
                onChange={onChange}
            />
          </label>
        </div>
    )
}

export default FormField;
